import React from "react";
//import Student from './Student';
class StudentProps extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            students: [{
                    name: 'rajan',
                    age: 23,
                    degree: 'be'
                },
                {
                    name: 'anand',
                    age: 23,
                    degree: 'be'
                },
                {
                    name: 'gitaan',
                    age: 23,
                    degree: 'be'
                },
            ]
        }
    }
    render() {
        return ( <
            React.Fragment >

            <
            div className = "p-3" >
            <
            div className = "container" >
            <
            div className = "row" >
            <
            div className = "col" >
            <
            div className = "card" >
            <
            div className = "card-body bg-light" >
            <
            ui className = "list-group" >
            <
            li className = "list-group-item" >
            NAME: { this.props.name } <
            /li> <
            li className = "list-group-item" >
            AGE: { this.props.age } <
            /li> <
            li className = "list-group-item" >
            DEGREE: { this.props.degree } <
            /li> < /
            ui > <
            /div> < /
            div > <
            /div> < /
            div > <
            /div>  < /
            div > < /
            React.Fragment >
        )
    };

}
export default StudentProps;
